import React, { Component } from 'react'
import { storeProducts } from "./data"

export default class CustomObj extends Component {
    constructor(props) {
        super(props)
        this.state = {
            store: storeProducts.data,
        }
    }

    render() {
        let store = this.state.store;
        var tempObj = {};
        var eleData = {};
        var salePersonData = {};

        Object.keys(store).forEach(function (k) {
            var val = store[k];
            var key = val['customer_name'];
            var ele = val['month'];
            var itemName = val['item_name']
            var salesPerson = val['salesperson_name']

            if (!tempObj[key])
                tempObj[key] = [];

            if(!eleData[ele])
                eleData[ele] = []

            if(!salePersonData[itemName])
                salePersonData[itemName] = []

            salePersonData[itemName].push(salesPerson)
            eleData[ele].push(salePersonData);
            tempObj[key].push(eleData);

        });
        console.log("salePersonData :", salePersonData);
        // console.log("result :", eleData);
        // console.log("result :", eleData);
        // console.log("result :", tempObj);

        return (
            <>
                <h1>Hey</h1>
            </>
        )
    }
}
